import React from 'react';
import styled from 'styled-components';
import PostBox from '../components/SenderPage/PostBox';
import CenterView from '../components/publicComponents/CenterView';
import Container from '../components/publicComponents/Container';
import { usePost } from '../Hooks/usePost';

interface ISenderPage {
    onClick: (_id: string, fromAccount: string) => void;
    _id: string;
    fromAccount: string;
}

const SenderPage: React.FC<ISenderPage>= ({ onClick, _id, fromAccount }) => {

    const post = usePost();

    return (
        <Container>
            <CenterView>
                    <Row>
                        <PostBox onClick={() => onClick(_id, fromAccount)}  />
                    </Row>
            </CenterView>
        </Container>
    )
}

export default SenderPage;

const Row = styled.div`
    min-width: 100%;
    max-width: 100%;
    height: 100%;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
`;
